            backgroundColor: "green",
            width: "10%",
            height: "100vh",
            display: "flex",
            flexDirection: "row",
            display:"flex",
        }}
      >

        <Sider />
        </div>

        <div style={{backgroundColor:"gray" ,width:"50%"}}>



      </div>
    </>
  );
}
export default Home;
